import React from 'react';
import TodoItem from "./TodoItem";
const Todos = (props) => {
    return(
        //<h3>{props.todos[0].title}</h3>
        <div>
            {props.todos.map((todo)=>{
                return <TodoItem todo ={todo}/>
            })}
        </div>
        
    )
}
 
